import React from "react";
import SidebarMenu from "react-bootstrap-sidebar-menu";
import ColorLogo from "../Assets/Color logo.png";

const Sidebar = () => {
  return (
    <div class="row">
      <div class="col-1">
        <SidebarMenu className="">
          <SidebarMenu.Brand>
            <img src={ColorLogo} />
          </SidebarMenu.Brand>
        </SidebarMenu>
      </div>
    </div>
  );
};

export default Sidebar;
